attrs.description:
Если Вы не знаете как Вам лучше использовать свою площадь, или вы хотите придумать удачную перепланировку, или у Вас идеи но вы не знаете как это оформить и правильно согласовать- тогда вам необходима эта услуга.
В нее входит: обмеры;
                            возможные варианты перепланировки
                                                                            (без нарушений);
                            план расстановки мебели и оборудования 
                                                           (с габаритными размерами);

Разработка конструкторской документации. 
Обсуждение проекта с заказчиком; 
Тщательное изучение существующих продуктов и всей доступной информации о них (3D-модели, тех. документация, чертежи); 
Разработка концепции и ее перенос в формат эскизов; 
создание 3D-модели.
